import React from "react";
import "../css/about.scss";

const About = () => {
  return (
    <div className="aboutFlexContainer">
      <h1 className="aboutFlexContainer__title">A propos de moi</h1>
      <div className="aboutFlexContainer__boxMain">
        <p className="aboutFlexContainer__mainText">
          Bonjour ou bonsoir, <br />
          je m'appelle Mero Nicolas, et j'habite dans le sud ouest de la France.{" "}
          <br />
          Après plusieurs emplois alimentaires, j'ai décidé de m'orienté vers le
          développement web, juste de la curiositée qui peu à peu c'est
          transformé en passion. J'aime les jeux vidéo, l'informatique,
          découvrir de nouvelles technologies et bien sur... le développement
          web. N'hésitez pas à vous promenez sur mon portfolio et à me faire vos
          retours dessus ! J'apprécie les critiques constructives !
        </p>
      </div>
    </div>
  );
};

export default About;
